import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="row">
        <div>
          <input placeholder="Search"/>
        </div>
      </div>
      <div className="row">
        <div className="location">
          <h1>San Francisco, CA</h1>
          <br/>
          Saturday 11, January 2020

        </div>
      </div>
      <div className="row">
      </div>
      <div className="row">
      </div>
    </div>
  );
}

export default App;
